package Strings;

/**
 * @author sandeepa
 */

public class ValidPalindromeAtMostOneCharRemoval {

	public static void main(String[] args) {
		String s = "";
		System.out.println("Is string '" + s + "' a valid palindrome, with at most one char removed? := " + new ValidPalindromeAtMostOneCharRemoval().validPalindrome(s));
	}

	private boolean validPalindrome(String s) {
		if (s == null || s.length() == 0) {
			return true;
		}

		return validPalindrome(s, 0, s.length() - 1, false);
	}

	private boolean validPalindrome(String s, int start, int end, boolean once) {
		if (start == end) {
			return true;
		}

		while (start < end) {
			if (s.charAt(start) != s.charAt(end)) {
				if (once) return false;
				once = true;
				return validPalindrome(s, start + 1, end, once) || validPalindrome(s, start, end - 1, once);
			}

			start++;
			end--;
		}

		return true;
	}
}
